import logo from './logo.svg';
import './App.css';
import $ from 'jquery'

class TechnicalCharacteristics {
  constructor(brand, model, productionYear, carcass, mileage) {
    this.brand = brand
    this.model = model
    this.productionYear = productionYear
    this.body = carcass
    this.mileage = mileage
  }
}

class Car {
  constructor(name, description, photo, price, contacts, technicalCharacteristics, options) {
    this.name = name
    this.description = description
    this.photo = photo
    this.price = price
    this.contacts = contacts
    this.technicalCharacteristics = technicalCharacteristics
    this.options = options
  }
}

let car = new Car("Моя машина", "нормальное авто", ["1.jpg", "2.jpg"], 10 , "+79253221649")

function App() {

  return (
    <>
      <button onClick={() => {
