          data: {car: car}
        }).then(it =>
        {
          $.get("http://38eee3a1c015.ngrok.io/cars").then(it => {console.log(it)})
          console.log(it)
        })
      }}>AddCar</button>
      <div>
        <input id={"car-input"} placeholder={"CarId"}/>
