          console.log($("#car-input").val())
          $.get(`http://38eee3a1c015.ngrok.io/cars/delete-car?id=${$("#car-input").val()}`).then(it => {
            $.get("http://38eee3a1c015.ngrok.io/cars").then(it => {console.log(it)})
            console.log(it)
          })

        }}>RemoveCar</button>
      </div>

    </>
  );
}

export default App;
